import {RegistroRoutingModule} from './registro-routing.module'
import {  RegistroComponent } from './registro.component';


@NgModule({
  declarations: [
   RegistroComponent,

   
  ],
  imports: [
    CommonModule,
    RegistroRoutingModule,
    NgbModule
    
  ],
  providers: [],
  bootstrap: [RegistroComponent],
